import React, { Component } from 'react';
import warrantyBG from '../../assets/warranty_bg.png';
import './style.css'
import Country from './Country'
class Form extends Component {
    render() {
        return (
            <div>
                <img src={warrantyBG}/>
                <div className='warranty__content'>
                    <h2>WARRANTY FORM</h2>
                    <hr/>

                  <Country/>
                </div>
            </div>
        );
    }
}

export default Form;
